import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer'

const coustomer = [
  {
  'id': 1,
  'image': 'htttps://placeimg.com/64/64/1',
  'name': '킹석중',
  'birthday': '981112',
  'gender': '남자',
  'job': '대통령'
  },
  {
    'id': 2,
    'image': 'htttps://placeimg.com/64/64/2',
    'name': '김용철',
    'birthday': '980119',
    'gender': '개',
    'job': '애완용'
  },
  {
      'id': 3,
      'image': 'htttps://placeimg.com/64/64/3',
      'name': '이호영',
      'birthday': '980224',
      'gender': '남자',
      'job': '비서'
  }
]

function App() {
  return (
    <Customer
    id={coustomer.id}
    image={coustomer.image}
    name={coustomer.name}
    birthday={coustomer.birthday}
    gender={coustomer.gender}
    job={coustomer.job}
    />
  );
}

export default App;
